Another &quot;30-second Thing&quot;  
I bought some generic &quot;30cm 15 SMD LED strips&quot; to put in my Flashforge. The 3M tape works okay, but on wood it gives out over time. Didn't want to drill into the case for a zip tie, so I printed these out. Works okay so far, but changes appreciated!<br />
Meant to be light weight... Flat 2mm wide section can print funky on some machines. Might thicken that up.
